import React, { useState, useRef } from 'react';
import Barcode from 'react-barcode';
import { toPng, toJpeg, toSvg } from 'html-to-image';

function App() {
  const [barcodeValue, setBarcodeValue] = useState('');
  const barcodeRef = useRef();

  const handleInputChange = (e) => {
    const value = e.target.value;
    if (/^\d*$/.test(value)) {
      setBarcodeValue(value);
    }
  };

  const downloadImage = async (format) => {
    if (!barcodeValue) return;

    try {
      let dataUrl;
      switch (format) {
        case 'PNG':
          dataUrl = await toPng(barcodeRef.current);
          break;
        case 'JPG':
          dataUrl = await toJpeg(barcodeRef.current);
          break;
        case 'SVG':
          dataUrl = await toSvg(barcodeRef.current);
          break;
        default:
          return;
      }

      const link = document.createElement('a');
      link.download = `barcode-${barcodeValue}.${format.toLowerCase()}`;
      link.href = dataUrl;
      link.click();
    } catch (err) {
      console.error('Error exporting barcode:', err);
    }
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-50 to-indigo-100 py-12 px-4 sm:px-6 lg:px-8">
      <div className="max-w-md mx-auto bg-white rounded-2xl shadow-xl overflow-hidden md:max-w-2xl p-8 transition-all duration-300 hover:shadow-2xl">
        <div className="text-center">
          <div className="flex items-center justify-center mb-6">
            <svg className="w-8 h-8 text-blue-600 mr-2" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M12 4v1m6 11h2m-6 0h-2v4m0-11v3m0 0h.01M12 12h4.01M16 20h4M4 12h4m12 0h.01M5 8h2a1 1 0 001-1V5a1 1 0 00-1-1H5a1 1 0 00-1 1v2a1 1 0 001 1zm12 0h2a1 1 0 001-1V5a1 1 0 00-1-1h-2a1 1 0 00-1 1v2a1 1 0 001 1zM5 20h2a1 1 0 001-1v-2a1 1 0 00-1-1H5a1 1 0 00-1 1v2a1 1 0 001 1z"></path>
            </svg>
            <h1 className="text-3xl font-bold text-gray-900">ბარკოდის გენერატორი</h1>
          </div>

          <div className="mb-8">
            <div className="relative">
              <input
                type="text"
                value={barcodeValue}
                onChange={handleInputChange}
                placeholder="შეიყვანეთ ციფრები"
                className="w-full px-4 py-3 border-2 border-gray-200 rounded-lg focus:outline-none focus:border-blue-500 transition-colors duration-200 text-lg"
              />
              {barcodeValue && (
                <span className="absolute right-3 top-1/2 transform -translate-y-1/2 text-green-500">
                  <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M5 13l4 4L19 7"></path>
                  </svg>
                </span>
              )}
            </div>
            <p className="mt-2 text-sm text-gray-500">მხოლოდ ციფრები დაშვებულია</p>
          </div>

          {barcodeValue && (
            <div className="space-y-6 animate-fade-in">
              <div ref={barcodeRef} className="flex justify-center p-6 bg-white border-2 border-gray-100 rounded-lg shadow-sm">
                <Barcode
                  value={barcodeValue}
                  format="CODE128"
                  width={2}
                  height={100}
                  displayValue={true}
                />
              </div>

              <div className="grid grid-cols-3 gap-4">
                {['PNG', 'JPG', 'SVG'].map((format) => (
                  <button
                    key={format}
                    onClick={() => downloadImage(format)}
                    className="flex items-center justify-center px-4 py-2 bg-gradient-to-r from-blue-600 to-blue-700 text-white rounded-lg hover:from-blue-700 hover:to-blue-800 transition-all duration-200 transform hover:scale-105 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:ring-offset-2 shadow-md"
                  >
                    <svg className="w-4 h-4 mr-2" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M4 16v1a3 3 0 003 3h10a3 3 0 003-3v-1m-4-4l-4 4m0 0l-4-4m4 4V4"></path>
                    </svg>
                    {format}
                  </button>
                ))}
              </div>
            </div>
          )}
        </div>
      </div>
    </div>
  );
}

export default App;
